import Routes from './Routes';
import Footer from './components/Footer';
import './style.css';

class App extends Component {

  render(){
    return(
      <div className='pageContainer'>
        <div className='contentWrap'>
          <Routes />
          <Footer />
        </div>
      </div>
    )
  }
}
export default App;
